<!DOCTYPE html>
<html lang="es">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>DEX QUIZ | Emprendimiento</title>
<link href="https://fonts.googleapis.com/css2?family=Space+Grotesk:wght@300;400;500;600;700&family=Orbitron:wght@400;700;900&family=Share+Tech+Mono&display=swap" rel="stylesheet">
<style>
*,*::before,*::after{margin:0;padding:0;box-sizing:border-box;-webkit-user-select:none;user-select:none;}
:root{
  --bg:#08090f;--s1:#0e1018;--s2:#13151f;--s3:#191c28;
  --border:rgba(255,255,255,0.07);--border2:rgba(255,255,255,0.12);
  --accent:#c8b8ff;--accentB:#8eb8ff;--accentG:#78ddb8;
  --gold:#f0d080;--red:#ff6680;--text:#d8d8e8;--muted:#4a4a68;--a1:#e8e8f0;
}
html{scroll-behavior:smooth;}
body{font-family:'Space Grotesk',sans-serif;background:var(--bg);color:var(--text);min-height:100vh;overflow-x:hidden;}
#bgCanvas{position:fixed;inset:0;z-index:0;pointer-events:none;opacity:.65;}

/* INTRO */
#intro{position:fixed;inset:0;z-index:9000;background:#000;display:flex;flex-direction:column;align-items:center;justify-content:center;overflow:hidden;}
#intro.out{animation:iOut .8s ease forwards;}
@keyframes iOut{to{opacity:0;transform:scale(1.04);pointer-events:none;}}

/* GIF container */
.gif-wrap{
  position:relative;z-index:2;
  display:flex;align-items:center;justify-content:center;
  width:100%;height:100%;
  position:absolute;inset:0;
}
.gif-wrap img{
  width:100%;
  height:100%;
  object-fit:cover;
  display:block;
  image-rendering:auto;
}

/* Overlay on top of GIF */
.gif-overlay{
  position:absolute;inset:0;z-index:3;
  pointer-events:none;
}

/* READY text */
.i-ready{
  position:absolute;bottom:40px;left:50%;transform:translateX(-50%);
  font-family:'Share Tech Mono',monospace;font-size:11px;letter-spacing:3px;text-transform:uppercase;
  color:rgba(200,184,255,.7);opacity:0;
  animation:blink .5s ease 11s forwards;white-space:nowrap;z-index:4;
}
@keyframes blink{0%{opacity:0}60%{opacity:1}100%{opacity:.85}}

/* APP */
#app{opacity:0;animation:appIn .7s ease 12.7s forwards;}
@keyframes appIn{to{opacity:1;}}
body::before{content:'';position:fixed;inset:0;z-index:0;pointer-events:none;
  background:radial-gradient(ellipse 55% 40% at 20% 15%,rgba(200,184,255,.04) 0%,transparent 60%),
             radial-gradient(ellipse 45% 35% at 80% 85%,rgba(142,184,255,.05) 0%,transparent 60%),
             radial-gradient(ellipse 30% 30% at 50% 50%,rgba(120,221,184,.025) 0%,transparent 70%);}

/* TOPBAR */
.topbar{position:sticky;top:0;z-index:100;backdrop-filter:blur(32px) saturate(200%);background:rgba(8,9,15,.9);border-bottom:1px solid var(--border);padding:0 28px;height:62px;display:flex;align-items:center;justify-content:space-between;gap:14px;}
.tb-brand{font-family:'Orbitron',monospace;font-weight:900;font-size:16px;letter-spacing:3px;background:linear-gradient(135deg,var(--accent),var(--accentB));-webkit-background-clip:text;-webkit-text-fill-color:transparent;background-clip:text;display:flex;align-items:center;gap:10px;flex-shrink:0;}
.tb-dot{width:7px;height:7px;border-radius:50%;background:var(--accent);box-shadow:0 0 10px var(--accent);animation:dotP 2s ease infinite;}
@keyframes dotP{0%,100%{box-shadow:0 0 6px var(--accent);}50%{box-shadow:0 0 18px var(--accent),0 0 36px rgba(200,184,255,.3);}}
.tb-prog{flex:1;max-width:360px;height:3px;background:rgba(255,255,255,.05);border-radius:100px;overflow:hidden;}
.prog-fill{height:100%;background:linear-gradient(90deg,var(--accent),var(--accentB));background-size:200%;animation:shimmer 2s linear infinite;border-radius:100px;width:0%;transition:width .5s ease;}
@keyframes shimmer{0%{background-position:0%}100%{background-position:200%}}
.tb-pts{display:flex;align-items:center;gap:6px;padding:7px 16px;background:rgba(240,208,128,.06);border:1px solid rgba(240,208,128,.2);border-radius:100px;font-family:'Orbitron',monospace;font-size:13px;font-weight:700;color:var(--gold);transition:all .3s;flex-shrink:0;}
.tb-pts.bump{animation:ptsBump .4s cubic-bezier(.34,1.56,.64,1);}
@keyframes ptsBump{0%{transform:scale(1)}50%{transform:scale(1.18);box-shadow:0 0 20px rgba(240,208,128,.3)}100%{transform:scale(1)}}
.tb-streak{display:flex;align-items:center;gap:5px;padding:7px 14px;background:var(--s1);border:1px solid var(--border);border-radius:100px;font-size:13px;font-weight:600;color:var(--muted);transition:all .3s;font-family:'Orbitron',monospace;flex-shrink:0;}
.tb-streak.hot{background:rgba(200,184,255,.07);border-color:rgba(200,184,255,.4);color:var(--accent);}

.container{max-width:720px;margin:0 auto;padding:44px 22px 100px;position:relative;z-index:1;}

/* Q CARD */
.q-card{background:linear-gradient(145deg,var(--s1),var(--s2));border:1px solid var(--border);border-radius:24px;padding:40px;margin-bottom:18px;position:relative;overflow:hidden;animation:cardIn .35s ease;box-shadow:0 4px 28px rgba(0,0,0,.4);}
@keyframes cardIn{from{opacity:0;transform:translateY(14px)}to{opacity:1;transform:translateY(0)}}
.q-card::before{content:'';position:absolute;top:0;left:0;right:0;height:1.5px;background:linear-gradient(90deg,transparent 0%,var(--accent) 30%,var(--accentB) 70%,transparent 100%);opacity:.5;}
.q-card::after{content:'';position:absolute;inset:0;pointer-events:none;background:radial-gradient(ellipse 55% 35% at 85% 15%,rgba(200,184,255,.022) 0%,transparent 60%);}
.q-num-bg{position:absolute;right:-5px;top:-14px;font-family:'Orbitron',monospace;font-size:108px;font-weight:900;color:rgba(255,255,255,.015);line-height:1;pointer-events:none;}
.q-chip{display:inline-flex;align-items:center;gap:6px;font-size:10px;letter-spacing:2px;text-transform:uppercase;color:rgba(200,184,255,.55);font-weight:600;margin-bottom:18px;font-family:'Share Tech Mono',monospace;padding:4px 12px;border:1px solid rgba(200,184,255,.13);border-radius:100px;background:rgba(200,184,255,.04);}
.q-chip-dot{width:4px;height:4px;border-radius:50%;background:var(--accent);box-shadow:0 0 6px var(--accent);animation:dotP 1.5s infinite;}
.q-text{font-family:'Space Grotesk',sans-serif;font-size:clamp(17px,2.5vw,21px);font-weight:600;line-height:1.45;letter-spacing:-.2px;margin-bottom:28px;color:var(--a1);}

.options{display:flex;flex-direction:column;gap:9px;}
.opt input[type="radio"]{display:none;}
.opt-label{display:flex;align-items:flex-start;gap:13px;padding:14px 17px;background:rgba(255,255,255,.022);border:1.5px solid rgba(255,255,255,.05);border-radius:13px;cursor:pointer;transition:all .2s cubic-bezier(.4,0,.2,1);font-size:14px;font-weight:400;color:rgba(216,216,232,.68);line-height:1.45;position:relative;}
.opt-badge{min-width:28px;height:28px;border-radius:7px;flex-shrink:0;border:1.5px solid rgba(255,255,255,.07);display:flex;align-items:center;justify-content:center;font-size:10px;font-weight:700;letter-spacing:.5px;font-family:'Orbitron',monospace;color:var(--muted);background:rgba(255,255,255,.02);transition:all .2s;margin-top:1px;}
.opt-label:hover{border-color:rgba(200,184,255,.3);background:rgba(200,184,255,.05);transform:translateX(5px);color:var(--text);}
.opt-label:hover .opt-badge{border-color:var(--accent);color:var(--accent);background:rgba(200,184,255,.1);}
.opt input:checked+.opt-label{border-color:rgba(200,184,255,.45);background:rgba(200,184,255,.08);color:var(--a1);box-shadow:0 0 0 1px rgba(200,184,255,.14),0 6px 20px rgba(200,184,255,.06);}
.opt input:checked+.opt-label .opt-badge{background:var(--accent);border-color:var(--accent);color:#0a0414;font-weight:900;}

.opt.ans-ok .opt-label{border-color:rgba(120,221,184,.6)!important;background:rgba(120,221,184,.08)!important;color:var(--accentG)!important;animation:okPop .5s cubic-bezier(.34,1.56,.64,1);}
.opt.ans-ok .opt-badge{background:var(--accentG)!important;border-color:var(--accentG)!important;color:#031208!important;}
.opt.ans-no .opt-label{border-color:rgba(255,102,128,.5)!important;background:rgba(255,102,128,.07)!important;color:var(--red)!important;animation:noShake .4s ease;}
.opt.ans-no .opt-badge{background:var(--red)!important;border-color:var(--red)!important;color:#1a0008!important;}
@keyframes okPop{0%{transform:translateX(5px) scale(1);}40%{transform:translateX(5px) scale(1.03);}70%{transform:translateX(5px) scale(.98);}100%{transform:translateX(5px) scale(1);}}
@keyframes noShake{0%{transform:translateX(0);}20%{transform:translateX(-6px);}40%{transform:translateX(5px);}60%{transform:translateX(-4px);}80%{transform:translateX(3px);}100%{transform:translateX(0);}}
.ans-badge{position:absolute;right:14px;top:50%;transform:translateY(-50%);font-size:16px;opacity:0;animation:badgeIn .4s cubic-bezier(.34,1.56,.64,1) .08s forwards;}
@keyframes badgeIn{to{opacity:1;}}
.q-card.flash-ok{animation:flashOk .55s ease;}
.q-card.flash-no{animation:flashNo .5s ease;}
@keyframes flashOk{0%{box-shadow:0 4px 28px rgba(0,0,0,.4)}35%{box-shadow:0 4px 50px rgba(120,221,184,.18),0 0 55px rgba(120,221,184,.09)}100%{box-shadow:0 4px 28px rgba(0,0,0,.4)}}
@keyframes flashNo{0%{box-shadow:0 4px 28px rgba(0,0,0,.4)}35%{box-shadow:0 4px 50px rgba(255,102,128,.13),0 0 55px rgba(255,102,128,.07)}100%{box-shadow:0 4px 28px rgba(0,0,0,.4)}}

.bpart{position:fixed;border-radius:50%;pointer-events:none;z-index:999;animation:bOut .85s ease forwards;}
@keyframes bOut{to{transform:translate(var(--tx),var(--ty)) scale(0);opacity:0;}}

.hint-bar{display:flex;align-items:center;justify-content:flex-end;margin-top:16px;gap:10px;}
.hint-cost{font-size:11px;color:var(--muted);}
.btn-hint{display:flex;align-items:center;gap:6px;padding:8px 16px;background:rgba(240,208,128,.05);border:1px solid rgba(240,208,128,.2);border-radius:100px;color:var(--gold);font-family:'Orbitron',monospace;font-size:10px;font-weight:700;letter-spacing:.5px;cursor:pointer;transition:all .2s;}
.btn-hint:hover{background:rgba(240,208,128,.12);border-color:rgba(240,208,128,.5);transform:translateY(-1px);}
.btn-hint:disabled{opacity:.3;cursor:not-allowed;transform:none;}
.hint-box{display:none;margin-top:12px;padding:13px 16px;background:rgba(240,208,128,.04);border:1px solid rgba(240,208,128,.14);border-left:2px solid var(--gold);border-radius:11px;font-size:13.5px;color:rgba(240,208,128,.85);line-height:1.6;animation:fadeSlide .3s ease;}
@keyframes fadeSlide{from{opacity:0;transform:translateY(-6px)}to{opacity:1;transform:translateY(0)}}
.hint-box.show{display:block;}

.nav-row{display:flex;align-items:center;justify-content:space-between;gap:12px;margin-top:20px;}
.btn-back{padding:12px 22px;background:var(--s2);border:1px solid var(--border);border-radius:11px;color:var(--muted);font-family:'Orbitron',monospace;font-size:10px;font-weight:700;letter-spacing:.5px;cursor:pointer;transition:all .2s;}
.btn-back:hover{border-color:var(--border2);color:var(--text);transform:translateY(-1px);}
.btn-next{padding:12px 28px;background:linear-gradient(135deg,var(--accent),var(--accentB));border:none;border-radius:11px;color:#08090f;font-family:'Orbitron',monospace;font-size:10px;font-weight:900;letter-spacing:1.5px;text-transform:uppercase;cursor:pointer;transition:all .2s;box-shadow:0 4px 18px rgba(200,184,255,.18);}
.btn-next:hover{transform:translateY(-2px);box-shadow:0 8px 28px rgba(200,184,255,.32);}
.btn-next:active{transform:translateY(0);}

#results{display:none;}
#results.show{display:block;animation:cardIn .5s ease;}
.res-hero{text-align:center;padding:54px 24px 42px;background:linear-gradient(145deg,var(--s1),var(--s2));border:1px solid var(--border);border-radius:24px;position:relative;overflow:hidden;margin-bottom:18px;box-shadow:0 4px 28px rgba(0,0,0,.4);}
.res-hero::before{content:'';position:absolute;top:0;left:0;right:0;height:1.5px;background:linear-gradient(90deg,transparent,var(--accent),var(--accentB),transparent);}
.score-ring{width:148px;height:148px;border-radius:50%;border:1.5px solid rgba(200,184,255,.2);background:var(--s3);display:flex;flex-direction:column;align-items:center;justify-content:center;margin:0 auto 26px;position:relative;animation:scaleIn .7s cubic-bezier(.34,1.56,.64,1);}
@keyframes scaleIn{from{transform:scale(.7);opacity:0}to{transform:scale(1);opacity:1}}
.score-ring::before{content:'';position:absolute;inset:-10px;border-radius:50%;border:1px solid rgba(200,184,255,.07);}
.score-n{font-family:'Orbitron',monospace;font-size:42px;font-weight:900;letter-spacing:-2px;background:linear-gradient(135deg,var(--accent),var(--accentB));-webkit-background-clip:text;-webkit-text-fill-color:transparent;background-clip:text;}
.score-s{font-size:10px;color:var(--muted);margin-top:2px;font-family:'Share Tech Mono',monospace;letter-spacing:1px;}
.res-title{font-family:'Orbitron',monospace;font-size:clamp(20px,4vw,34px);font-weight:900;letter-spacing:-1px;margin-bottom:10px;}
.res-desc{font-size:14px;color:var(--muted);max-width:420px;margin:0 auto;line-height:1.7;}
.final-pts{display:inline-flex;align-items:center;gap:9px;padding:12px 26px;background:rgba(240,208,128,.07);border:1.5px solid rgba(240,208,128,.25);border-radius:14px;margin:24px auto 0;font-family:'Orbitron',monospace;font-size:18px;font-weight:900;color:var(--gold);animation:ptsBump .6s ease .5s both;}
.stats-grid{display:grid;grid-template-columns:repeat(3,1fr);gap:12px;margin-bottom:18px;}
.stat-card{background:linear-gradient(145deg,var(--s1),var(--s2));border:1px solid var(--border);border-radius:16px;padding:20px 16px;text-align:center;}
.stat-v{font-family:'Orbitron',monospace;font-size:26px;font-weight:900;letter-spacing:-1px;background:linear-gradient(135deg,var(--accent),var(--accentB));-webkit-background-clip:text;-webkit-text-fill-color:transparent;background-clip:text;display:block;margin-bottom:5px;}
.stat-l{font-size:9px;letter-spacing:2px;text-transform:uppercase;color:var(--muted);font-weight:600;font-family:'Share Tech Mono',monospace;}
.feedback-card{padding:22px 26px;border-radius:16px;font-size:14px;line-height:1.8;margin-bottom:22px;animation:cardIn .5s ease .3s both;}
.fb-e{background:rgba(120,221,184,.04);border:1px solid rgba(120,221,184,.18);color:rgba(120,221,184,.9);}
.fb-g{background:rgba(142,184,255,.04);border:1px solid rgba(142,184,255,.18);color:rgba(142,184,255,.9);}
.fb-f{background:rgba(240,208,128,.04);border:1px solid rgba(240,208,128,.18);color:rgba(240,208,128,.9);}
.fb-p{background:rgba(255,102,128,.04);border:1px solid rgba(255,102,128,.18);color:rgba(255,102,128,.9);}
.btn-retry{display:block;width:fit-content;margin:0 auto;padding:14px 40px;background:linear-gradient(135deg,var(--accent),var(--accentB));border:none;border-radius:12px;color:#08090f;font-family:'Orbitron',monospace;font-size:11px;font-weight:900;letter-spacing:1.5px;text-transform:uppercase;cursor:pointer;transition:all .2s;box-shadow:0 6px 20px rgba(200,184,255,.2);}
.btn-retry:hover{transform:translateY(-2px);box-shadow:0 12px 30px rgba(200,184,255,.32);}
.quiz-wrap.hidden{display:none;}

.toast{position:fixed;top:74px;left:50%;transform:translateX(-50%);padding:11px 22px;border-radius:100px;font-family:'Orbitron',monospace;font-size:11px;font-weight:700;letter-spacing:.5px;z-index:1000;white-space:nowrap;display:none;pointer-events:none;}
.toast.pts{background:var(--gold);color:#100e00;box-shadow:0 6px 24px rgba(240,208,128,.3);}
.toast.streak{background:var(--accent);color:#0a0414;box-shadow:0 6px 24px rgba(200,184,255,.3);}
.toast.warn{background:var(--red);color:#fff;box-shadow:0 6px 24px rgba(255,102,128,.3);}
.toast.ok{background:var(--accentG);color:#031208;box-shadow:0 6px 24px rgba(120,221,184,.3);}
.toast.show{display:block;animation:toastIn .35s cubic-bezier(.34,1.56,.64,1);}
@keyframes toastIn{from{transform:translateX(-50%) translateY(-12px);opacity:0}to{transform:translateX(-50%) translateY(0);opacity:1}}

.cheat-modal{display:none;position:fixed;inset:0;z-index:9999;align-items:center;justify-content:center;background:rgba(0,0,0,.85);backdrop-filter:blur(16px);}
.cheat-modal.show{display:flex;animation:fIn .3s ease;}
@keyframes fIn{from{opacity:0}to{opacity:1}}
.cheat-box{background:var(--s2);border:1.5px solid var(--red);border-radius:20px;padding:42px 36px;max-width:380px;text-align:center;box-shadow:0 0 55px rgba(255,102,128,.14);}
.cheat-icon{font-size:48px;margin-bottom:14px;}
.cheat-title{font-family:'Orbitron',monospace;font-size:16px;font-weight:900;color:var(--red);margin-bottom:10px;letter-spacing:1px;}
.cheat-text{color:rgba(216,216,232,.6);font-size:14px;margin-bottom:16px;line-height:1.6;}
.cheat-warn{font-size:11px;color:rgba(255,102,128,.72);padding:10px 14px;border-left:2px solid var(--red);background:rgba(255,102,128,.05);border-radius:8px;text-align:left;font-weight:600;letter-spacing:.5px;}

.cmd-overlay{position:fixed;inset:0;background:#000;z-index:9998;display:none;align-items:center;justify-content:center;-webkit-user-select:text;user-select:text;}
.cmd-overlay.show{display:flex;}
.cmd-body{font-family:'Share Tech Mono',monospace;color:#00ff88;font-size:13px;line-height:2;white-space:pre;padding:40px;max-width:680px;width:100%;overflow-y:auto;max-height:80vh;-webkit-user-select:text;user-select:text;}

.chat-widget{position:fixed;bottom:24px;right:24px;z-index:5000;}
.chat-toggle{width:52px;height:52px;border-radius:14px;background:linear-gradient(135deg,var(--accent),var(--accentB));border:none;cursor:pointer;display:flex;align-items:center;justify-content:center;font-size:20px;box-shadow:0 6px 20px rgba(200,184,255,.24);transition:all .2s;color:#0a0414;}
.chat-toggle:hover{transform:scale(1.08) translateY(-2px);box-shadow:0 12px 30px rgba(200,184,255,.38);}
.chat-panel{position:absolute;bottom:64px;right:0;width:316px;background:var(--s1);border:1px solid rgba(200,184,255,.17);border-radius:18px;box-shadow:0 20px 58px rgba(0,0,0,.6);display:none;flex-direction:column;overflow:hidden;animation:cardIn .3s ease;}
.chat-panel.show{display:flex;}
.chat-head{padding:14px 16px;border-bottom:1px solid rgba(200,184,255,.07);background:rgba(200,184,255,.028);display:flex;align-items:center;justify-content:space-between;}
.chat-name{font-family:'Orbitron',monospace;font-size:11px;font-weight:700;display:flex;align-items:center;gap:7px;color:var(--accent);}
.chat-dot{width:6px;height:6px;border-radius:50%;background:var(--accentG);animation:dotP 1.5s infinite;}
.chat-mood{font-size:15px;margin-left:2px;}
.chat-close{background:none;border:none;color:var(--muted);cursor:pointer;font-size:15px;line-height:1;transition:color .2s;}
.chat-close:hover{color:var(--text);}
.chat-msgs{flex:1;max-height:268px;overflow-y:auto;padding:12px;display:flex;flex-direction:column;gap:8px;}
.chat-msgs::-webkit-scrollbar{width:3px;}
.chat-msgs::-webkit-scrollbar-thumb{background:rgba(200,184,255,.12);border-radius:3px;}
.cmsg{display:flex;}
.cmsg.user{justify-content:flex-end;}
.cmsg-bubble{max-width:84%;padding:9px 12px;border-radius:11px;font-size:12.5px;line-height:1.55;}
.cmsg.user .cmsg-bubble{background:linear-gradient(135deg,var(--accent),var(--accentB));color:#0a0414;font-weight:600;border-bottom-right-radius:2px;}
.cmsg.bot .cmsg-bubble{background:var(--s3);color:rgba(216,216,232,.85);border:1px solid rgba(200,184,255,.07);border-bottom-left-radius:2px;}
.typing{display:flex;gap:4px;align-items:center;padding:10px 14px;}
.typing span{width:5px;height:5px;border-radius:50%;background:var(--accent);opacity:.4;animation:typeDot 1.2s ease infinite;}
.typing span:nth-child(2){animation-delay:.2s;}
.typing span:nth-child(3){animation-delay:.4s;}
@keyframes typeDot{0%,60%,100%{opacity:.3;transform:translateY(0)}30%{opacity:1;transform:translateY(-4px)}}
.chat-input-row{padding:9px;border-top:1px solid rgba(200,184,255,.06);display:flex;gap:7px;}
.chat-input{flex:1;padding:9px 12px;background:var(--s3);border:1px solid rgba(200,184,255,.1);border-radius:9px;color:var(--text);font-family:'Space Grotesk',sans-serif;font-size:13px;outline:none;transition:border-color .2s;-webkit-user-select:text;user-select:text;}
.chat-input:focus{border-color:rgba(200,184,255,.32);}
.chat-input::placeholder{color:var(--muted);}
.chat-send{padding:9px 13px;background:var(--accent);border:none;border-radius:9px;color:#0a0414;cursor:pointer;font-weight:900;font-size:14px;transition:all .2s;}
.chat-send:hover{transform:translateY(-1px);}
@keyframes cf{to{transform:translate(var(--cx),var(--cy)) rotate(720deg);opacity:0;}}
@media(max-width:560px){
  .container{padding:26px 12px 80px;}.q-card{padding:24px 16px;}.topbar{padding:0 12px;gap:8px;}

<script>
(()=>{
  const c=document.getElementById('bgCanvas'),ctx=c.getContext('2d');
  let W,H,pts=[];
  const resize=()=>{W=c.width=window.innerWidth;H=c.height=window.innerHeight;};
  resize();window.addEventListener('resize',resize);
  const cols=['rgba(200,184,255,','rgba(142,184,255,','rgba(120,221,184,','rgba(255,255,255,'];
  for(let i=0;i<120;i++)pts.push({x:Math.random()*2000,y:Math.random()*2000,vx:(Math.random()-.5)*.12,vy:(Math.random()-.5)*.12+.08,r:Math.random()*1.5+.25,a:Math.random()*.45+.1,c:cols[~~(Math.random()*cols.length)],tw:Math.random()*Math.PI*2,trail:Math.random()>.76});
  const draw=()=>{
    ctx.clearRect(0,0,W,H);
    pts.forEach(p=>{p.x+=p.vx;p.y+=p.vy;p.tw+=.022;if(p.y>H+8){p.y=-5;p.x=Math.random()*W;}if(p.x<-8||p.x>W+8)p.vx*=-1;const a=p.a*(0.5+0.5*Math.sin(p.tw));if(p.trail){const g=ctx.createLinearGradient(p.x,p.y-11,p.x,p.y);g.addColorStop(0,'transparent');g.addColorStop(1,p.c+a+')');ctx.beginPath();ctx.strokeStyle=g;ctx.lineWidth=p.r*.65;ctx.moveTo(p.x,p.y-11);ctx.lineTo(p.x,p.y);ctx.stroke();}ctx.beginPath();ctx.arc(p.x,p.y,p.r,0,Math.PI*2);ctx.fillStyle=p.c+a+')';ctx.fill();});
    requestAnimationFrame(draw);
  };
  draw();
})();

const L=['A','B','C','D'];
const HC=100,SP=250,CP=10,CHT=9000;
let shuf=[],idx=0,ans=new Map(),hints=new Set();
let pts=SP,streak=0,best=0,cBuf='',mc=false,kBuf='',kList=null;

document.addEventListener('copy',e=>{e.preventDefault();cheat();});

document.addEventListener('keydown',e=>{
  if(['PrintScreen','F12'].includes(e.key)||((e.ctrlKey||e.metaKey)&&e.shiftKey&&['I','S'].includes(e.key.toUpperCase()))){e.preventDefault();e.stopPropagation();cheat();return false;}
  const k=e.key.toUpperCase();
  if(/[A-Z]/.test(k)){cBuf+=k;if(cBuf.includes('SPREAD')){spreadAct();cBuf='';}if(cBuf.length>20)cBuf=cBuf.slice(-20);}
  else if(e.key==='Backspace')cBuf=cBuf.slice(0,-1);
  else if(e.key==='Escape')cBuf='';
},true);

function cheat(){const m=document.getElementById('cheatM');m.classList.add('show');setTimeout(()=>m.classList.remove('show'),3000);}
function spreadAct(){pts=CHT;updPts(true);showT(' SPREAD: 9000 PTS','pts');shuf.forEach((_,i)=>ans.set(i,true));setTimeout(calcRes,600);}
function updPts(b=false){document.getElementById('ptsN').textContent=pts;if(b){const d=document.getElementById('ptsDisp');d.classList.remove('bump');void d.offsetWidth;d.classList.add('bump');setTimeout(()=>d.classList.remove('bump'),500);}}
function showT(msg,type='pts'){const ids={pts:'tPts',streak:'tStreak',warn:'tWarn',ok:'tOk'};const t=document.getElementById(ids[type]||'tWarn');if(!t)return;t.textContent=msg;t.classList.remove('show');void t.offsetWidth;t.classList.add('show');clearTimeout(t._t);t._t=setTimeout(()=>t.classList.remove('show'),2400);}
function addPts(n,msg,type='pts'){pts=Math.max(0,pts+n);updPts(true);showT(msg,type);}
function shuffle(a){const r=[...a];for(let i=r.length-1;i>0;i--){const j=~~(Math.random()*(i+1));[r[i],r[j]]=[r[j],r[i]];}return r;}
function init(){shuf=shuffle(Qs);idx=0;ans.clear();hints.clear();pts=SP;streak=0;best=0;updPts();render();}

function render(){
  const q=shuf[idx];const opts=shuffle(q.o);
  const p=((idx+1)/shuf.length)*100;
  document.getElementById('progBar').style.width=p+'%';
  const hU=hints.has(idx),canH=pts>=HC&&!hU,isL=idx===shuf.length-1;
  document.getElementById('qWrap').innerHTML=`
    <div class="q-card" id="qCard">
      <div class="q-num-bg">${idx+1}</div>
      <div class="q-chip"><div class="q-chip-dot"></div>Pregunta ${idx+1} / ${shuf.length}</div>
      <div class="q-text">${q.q}</div>
      <div class="options" id="optsC">
        ${opts.map((o,i)=>`<div class="opt" id="opt${i}"><input type="radio" name="ans" id="o${i}" value="${o.c?'c':'w'}"><label class="opt-label" for="o${i}"><span class="opt-badge">${L[i]}</span>${o.t}</label></div>`).join('')}
      </div>
      <div class="hint-bar"><span class="hint-cost">Pista: ${HC} pts</span><button class="btn-hint" id="hBtn" onclick="useHint()" ${!canH?'disabled':''}> ${hU?'Usada':canH?'Pista':'Sin pts'}</button></div>
      ${hU?`<div class="hint-box show"> ${q.h}</div>`:'<div class="hint-box" id="hBox"></div>'}
    </div>
    <div class="nav-row">
      ${idx>0?`<button class="btn-back" onclick="prevQ()"> ANTERIOR</button>`:'<span></span>'}
      ${isL?`<button class="btn-next" onclick="finish()">FINALIZAR </button>`:`<button class="btn-next" onclick="nextQ()">SIGUIENTE </button>`}
    </div>`;
  if(ans.has(idx)){const val=ans.get(idx);document.querySelectorAll('input[name="ans"]').forEach(r=>{if((r.value==='c')===val)r.checked=true;});}
  document.querySelectorAll('input[name="ans"]').forEach(r=>r.addEventListener('change',()=>handleAns(r)));
}

function handleAns(r){
  const isC=r.value==='c',prev=ans.get(idx);
  ans.set(idx,isC);
  document.querySelectorAll('.opt').forEach(el=>el.classList.remove('ans-ok','ans-no'));
  document.querySelectorAll('.opt').forEach(el=>{
    const inp=el.querySelector('input');
    if(inp&&inp.checked){
      el.classList.add(isC?'ans-ok':'ans-no');
      const lbl=el.querySelector('.opt-label');
      if(lbl&&!lbl.querySelector('.ans-badge')){const b=document.createElement('span');b.className='ans-badge';b.textContent=isC?'':'';lbl.appendChild(b);}
    }
  });
  const card=document.getElementById('qCard');
  if(card){card.classList.remove('flash-ok','flash-no');void card.offsetWidth;card.classList.add(isC?'flash-ok':'flash-no');}
  if(prev===undefined){
    if(isC){streak++;if(streak>best)best=streak;const bonus=CP+(streak>=3?5:0);addPts(bonus,`+${bonus} pts ${streak>=3?' ':''}`,streak>=3?'streak':'ok');if(streak>=3)burstP(streak);setBM(streak>=5?'':'');}
    else{streak=Math.max(0,streak-1);addPts(0,' Incorrecto','warn');setBM('');setTimeout(()=>setBM(''),2000);}
    updStreak();
  }
  if(idx<shuf.length-1)setTimeout(nextQ,380);
}

function burstP(n){
  const cols=['#c8b8ff','#8eb8ff','#78ddb8','#ffffff','#f0d080'];
  const cnt=Math.min(n*5,28);
  for(let i=0;i<cnt;i++){
    const el=document.createElement('div');el.className='bpart';
    const sz=Math.random()*7+3,angle=Math.random()*Math.PI*2,dist=Math.random()*130+50;
    el.style.cssText=`width:${sz}px;height:${sz}px;background:${cols[~~(Math.random()*cols.length)]};top:50%;left:50%;--tx:${Math.cos(angle)*dist}px;--ty:${Math.sin(angle)*dist}px;`;
    document.body.appendChild(el);setTimeout(()=>el.remove(),900);
  }
}

function updStreak(){document.getElementById('streakN').textContent=streak;const p=document.getElementById('streakPill');p.classList.toggle('hot',streak>=3);if(streak>=3)showT(` RACHA ${streak}!`,'streak');}
function useHint(){if(hints.has(idx)||pts<HC)return;hints.add(idx);addPts(-HC,`-${HC} pts pista`,'warn');const b=document.getElementById('hBox');if(b){b.textContent=' '+shuf[idx].h;b.classList.add('show');}const btn=document.getElementById('hBtn');if(btn){btn.disabled=true;btn.textContent=' Usada';}}
function nextQ(){const s=document.querySelector('input[name="ans"]:checked');if(!s){showT(' Elige una respuesta','warn');return;}if(idx<shuf.length-1){idx++;render();}}
function prevQ(){if(idx>0){idx--;render();}}
function finish(){const s=document.querySelector('input[name="ans"]:checked');if(s)ans.set(idx,s.value==='c');calcRes();}

function calcRes(){
  let correct=0;ans.forEach(v=>{if(v)correct++;});
  const p=(correct/shuf.length)*100,score=(p/100)*5;
  document.getElementById('qWrap').classList.add('hidden');
  const res=document.getElementById('results');res.classList.add('show');
  document.getElementById('scoreN').textContent=score.toFixed(1);
  document.getElementById('stC').textContent=correct+'/'+shuf.length;
  document.getElementById('stP').textContent=p.toFixed(0)+'%';
  document.getElementById('stB').textContent=best;
  document.getElementById('finalPts').textContent=pts;
  let ti,de,fb,fc;
  if(p>=90){ti='Excelente! ';de='Dominas el emprendimiento. Eres un futuro empresario!';fb=' Conocimiento slido. Cualquier startup estara feliz de tenerte en el equipo.';fc='fb-e';}
  else if(p>=80){ti='Muy Bien! ';de='Base slida. Solo refuerza algunos temas especficos.';fb=' Muy cerca de la cima. Revisa los temas fallados e intntalo de nuevo.';fc='fb-g';}
  else if(p>=70){ti='Buen Trabajo ';de='Buena base, hay espacio para crecer ms.';fb=' Profundiza en finanzas bsicas y conceptos de mercado.';fc='fb-f';}
  else if(p>=60){ti='Vas Bien ';de='Encaminado. Sigue estudiando y practica ms.';fb=' Refuerza los conceptos clave e intenta de nuevo.';fc='fb-f';}
  else{ti='A Estudiar! ';de='Momento perfecto para aprender desde las bases.';fb=' Revisa los fundamentos. El fracaso es parte del proceso.';fc='fb-p';}
  document.getElementById('resTitle').textContent=ti;document.getElementById('resDesc').textContent=de;
  const fc2=document.getElementById('fbCard');fc2.textContent=fb;fc2.className='feedback-card '+fc;
  setBM(p>=80?'':'');if(p>=80)setTimeout(confetti,400);
}

function confetti(){
  const cols=['#c8b8ff','#8eb8ff','#78ddb8','#f0d080','#ff6680','#fff'];
  const s=document.createElement('style');s.textContent='@keyframes cf{to{transform:translate(var(--cx),var(--cy)) rotate(720deg);opacity:0;}}';document.head.appendChild(s);
  for(let i=0;i<80;i++){const el=document.createElement('div');const sz=Math.random()*10+4;el.style.cssText=`position:fixed;width:${sz}px;height:${sz}px;background:${cols[~~(Math.random()*cols.length)]};left:${Math.random()*100}vw;top:-20px;z-index:9990;pointer-events:none;border-radius:${Math.random()>.5?'50%':'3px'};--cx:${(Math.random()*200-100)}vw;--cy:${Math.random()*120+20}vh;animation:cf ${Math.random()*2+1.5}s ease ${Math.random()*1.2}s forwards;opacity:1;`;document.body.appendChild(el);setTimeout(()=>el.remove(),5000);}
}

function getReply(msg){
  const m=msg.toLowerCase().normalize('NFD').replace(/[\u0300-\u036f]/g,'');
  for(const e of KB){if(e.k.some(k=>m.includes(k.normalize('NFD').replace(/[\u0300-\u036f]/g,'')))){if(e.m)setBM(e.m);return e.r;}}
  setBM('');
  return "No tengo esa respuesta an  Pregntame sobre el quiz, puntos, emprendimiento o cualquier concepto de negocios. Estoy aqu!";
}

function toggleChat(){
  const p=document.getElementById('chatPanel');p.classList.toggle('show');
  if(p.classList.contains('show')&&document.getElementById('chatMsgs').children.length===0)
    setTimeout(()=>addBM('Hola!  Soy DEX, tu asistente de emprendimiento. Pregntame sobre el quiz, puntos, estrategias, negocios y ms. En qu te ayudo?'),300);
}

function sendMsg(){
  const inp=document.getElementById('chatIn'),msg=inp.value.trim();if(!msg)return;
  addUM(msg);inp.value='';
  if(msg==='/MC2011'){mc=true;kBuf='';setTimeout(showCMD,400);return;}
  if(msg==='/C'&&mc){execCMD();return;}
  const msgs=document.getElementById('chatMsgs');
  const typing=document.createElement('div');typing.className='cmsg bot';typing.id='typingEl';
  typing.innerHTML='<div class="cmsg-bubble"><div class="typing"><span></span><span></span><span></span></div></div>';
  msgs.appendChild(typing);msgs.scrollTop=msgs.scrollHeight;
  setTimeout(()=>{const t=document.getElementById('typingEl');if(t)t.remove();addBM(getReply(msg));},700+Math.random()*450);
}

function addUM(text){const c=document.getElementById('chatMsgs'),d=document.createElement('div');d.className='cmsg user';d.innerHTML=`<div class="cmsg-bubble">${text}</div>`;c.appendChild(d);c.scrollTop=c.scrollHeight;}
function addBM(text){const c=document.getElementById('chatMsgs'),d=document.createElement('div');d.className='cmsg bot';d.innerHTML=`<div class="cmsg-bubble">${text.replace(/\n/g,'<br>')}</div>`;c.appendChild(d);c.scrollTop=c.scrollHeight;}

setTimeout(init,12800);
</script>
